import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import { useHistory } from 'react-router';
import {
    auth
} from '../firebase/firebase.config';

const userPassAuth = () => {
    const email = document.getElementById("email").value;
    const password = document.getElementById("password").value;
    auth.signInWithEmailAndPassword(email, password);
    // .then((userCredential) => {
    //     var user = userCredential.user;
    // })
    // .catch((error) => {
    //     var errorCode = error.code;
    //     var errorMessage = error.message;
    // });
}

function Login() {



    return (
    <div className="login">
        <form className="" noValidate autoComplete="off">
            <h2>Admin Panel-ზე შესვლა</h2>
            <br />
            <TextField label="ელ. ფოსტა" className="login-input" id="email" />
            <br />
            <TextField label="პაროლი" className="login-input" id="password" />
            <br/>
            <Button variant="contained" color="primary" onClick={userPassAuth}>Primary</Button>
        </form>
    </div>
  );
}

export default Login;
